#include <stdbool.h>

int main() {
    int A[3][3];
    int N;
    int b[10];

    for (int i = 0; i < 3; i++) {
        for (int j = 0; j < 3; j++) {
            scanf("%d", &A[i][j]);
        }
    }

    scanf("%d", &N);
    for (int i = 0; i < N; i++) {
        scanf("%d", &b[i]);
    }

    bool bingo = false;

    // Check rows
    for (int i = 0; i < 3; i++) {
        bool row_bingo = true;
        for (int j = 0; j < 3; j++) {
            if (A[i][j] != -1 && A[i][j] != b[j]) {
                row_bingo = false;
                break;
            }
        }
        if (row_bingo) {
            bingo = true;
            break;
        }
    }

    // Check columns
    for (int j = 0; j < 3; j++) {
        bool col_bingo = true;
        for (int i = 0; i < 3; i++) {
            if (A[i][j] != -1 && A[i][j] != b[j]) {
                col_bingo = false;
                break;
            }
        }
        if (col_bingo) {
            bingo = true;
            break;
        }
    }

    // Check diagonals
    bool diag1_bingo = true;
    bool diag2_bingo = true;
    for (int i = 0; i < 3; i++) {
        if (A[i][i] != -1 && A[i][i] != b[i]) {
            diag1_bingo = false;
        }
        if (A[i][2-i] != -1 && A[i][2-i] != b[i]) {
            diag2_bingo = false;
        }
    }
    if (diag1_bingo) {
        bingo = true;
    }
    if (diag2_bingo) {
        bingo = true;
    }

    printf("%s\n", bingo ? "Yes" : "No");

    return 0;
}
